window.bookSummaryJSON = "<b>\"I will break you, Tessa Kelsinger, and then I will take what I want.\"</b><br><br>As the daughter of a lord, Tessa has always struggled with the constraints of her position. She wants to live her own life, marry whom she wants, and, most importantly, inherit her father’s keep before her uncle can steal it from her. But when her eight-year-old cousin, Duncan, wanders into the Dying Woods, awakening a powerful vampire king, all of that is lost.<br><br>Now, to save her cousin, she must become a courtesan in King Dante’s court, a place of renowned perversion where gorgeous vampires indulge in the taste of innocent beauties. It is in his service that she must bend to his every wish, even forced to bear the painful past that fuels her guilt.<br><br>When a werewolf tries to kill her, however, she learns that Dante has an affliction of his own, one that has kept him from finding love over these past centuries. Together, they set out to heal the other, hoping to find peace. But it won’t be easy.<br>Dark forces conspire against them, including ancient gods who seek to plunge the world into slavery. To survive this, Tessa must forgive those who have wronged her, including the one person she has never been able to absolve—herself.<br><br><i>The Ruined Maiden</i> is a spicy retelling of Beauty and the Beast, with the following tropes.<ul><li>Enemies to lovers</li><li>Happy for now</li><li>Dark Fairytale</li></ul>Buy now to start the experience!"; 
